description:
Verenigde Staten / Duitsland
Horror / Thriller
97 minuten

een goeie film

met Christina Ricci, Joshua Jackson en Jesse Eisenberg

Tijdens een heldere nacht met volle maan verliezen Ellie (Christina Ricci) en haar broer Jimmy de macht over het stuur en daardoor 
stort een andere weggebruikster met haar auto in een ravijn. Ze proberen haar te helpen, maar tijdens deze reddingsoperatie 
worden broer en zus gebeten door een hondachtig wezen. Sindsdien is hun leven niet meer hetzelfde. Het ongeluk blijkt veel meer 
dan een noodlottige samenloop van omstandigheden. De broer en zus beschikken plotseling over onverklaarbare lichamelijke krachten 
en zijn allebei enorm prikkelbaar. Ze worden beheerst door oncontroleerbare impulsen en kunnen hun nieuwe dierlijke 'gaven' maar 
moeilijk in bedwang houden. Het mysterie rond hun vloek moet opgelost worden voordat alles en iedereen meegesleurd wordt in de 
gevaarlijke klauwen van dit krachtige kwaad:
